import React,{useState,useEffect} from "react";
import { Box } from "@mui/material";    
import SideNav from "../Component/Nav/SideNav";
import { useSelector,useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { hideProfileCard } from "../Reducer/reducer";
import ChatBox from "../Component/ChatBox/ChatBox";
const PrivateRoute = ({ children }) => {
    const navigate = useNavigate()
    const dispatch = useDispatch()
    const AccountList = useSelector((state) => state.reducer.MainData.data);
    useEffect(()=>{
 if(AccountList.length === 0){
    navigate('/')
 }
    },[])
  return (
    <Box sx={{position:'relative'}}>
      <SideNav />
      <Box sx={{width:'75vw',ml:'265px',mt:12,position:'absolute',minHeight:'74vh',maxHeight:'auto'}} onClick={()=>dispatch(hideProfileCard())}>
       {children}
      </Box>
      <Box sx={{position:'absolute',left:5,bottom:0,zIndex:'1'}}>
        <ChatBox/>
      </Box>
    </Box>

  );
};
export default PrivateRoute;
